// src/App.js
import './App.css';
import { useState } from 'react';
import LoginForm from './components/LoginForm';
import HomePage from '.mainPage';

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  return (
    <div className="App">
      {!isLoggedIn ? (
        <LoginForm onLogin={() => setIsLoggedIn(true)} />
      ) : (
        <HomePage />
      )}
    </div>
  );
}

export default App;
